	@GET
	@Path("/getAllNotices.do")
	@Produces(MediaType.APPLICATION_JSON)
	public Map<String, Object> getAllNotices() {
		LOGGER.info("========== registerUser  webservice method entered ========");
		Map<String, Object> map = new LinkedHashMap<String, Object>();
		List<Notices> noticeList = new ArrayList();
		Notices firstObj = new Notices();
		firstObj.setId(1);
		firstObj.setCategory("Infotainment");
		firstObj.setDateAdded("2012-12-12");
		firstObj.setNoticeName("1-23-123");
		firstObj.setPublishedBy("Mukunf");

		Notices secondObj = new Notices();
		secondObj.setId(2);
		secondObj.setCategory("Infotainment");
		secondObj.setDateAdded("2012-11-12");
		secondObj.setNoticeName("4-Awing-All");
		secondObj.setPublishedBy("rajkumar");

		Notices thirdObj = new Notices();
		thirdObj.setId(3);
		thirdObj.setCategory("Infotainment");
		thirdObj.setDateAdded("2012-12-12");
		thirdObj.setNoticeName("1-222-1213");
		thirdObj.setPublishedBy("shreeansth");

		noticeList.add(thirdObj);
		noticeList.add(secondObj);
		noticeList.add(firstObj);
		Status status = new Status();
		status.setStatus("SUCCESS");
		map.put("notices", noticeList);
		map.put("STATUS", status);
		return map;
	}

